import React from "react";
import style from "./Header.module.css"
import {NavLink} from "react-router-dom";

const Header = (props) => {
    return (

        <div className={style.login}>
            {props.isAuth?props.login:<NavLink to="/login/"> Login</NavLink>}


        </div>
    )
}

export default Header
